How to find data within embedded documents array using id mongodb?<p>I am using mongodb with nodejs to find data in embedded document. strange fact is query works in database but not in actual nodejs code.</p>

<p>here is my data object: </p>

<pre><code>{
"_id" : ObjectId("5c65866488a1c53464e46dc7"),
"cat_lang" : [
    {
        "_id" : ObjectId("5c65866488a1c53464e46dc8"),
        "en" : "temp",
        "it" : "temp"
    }
],
"providers" : [
    {
        "_id" : ObjectId("5c65866488a1c53464e46dc9"),
        "provider_name" : "temp0",
        "url" : "http://uber.com",

    },
    {
        "_id" : ObjectId("5c65866488a1c53464e46dca"),
        "provider_name" : "temp1",
        "url" : "http://uber2.com",
    }
]}
</code></pre>

<p>I have tried these queries in the mongodb shell works perfectly fine.</p>

<pre><code>db.sideservices.findOne({"_id" : ObjectId("5c65866488a1c53464e46dc7")},{providers: {$elemMatch: {"_id" : ObjectId("5c65866488a1c53464e46dca")}}})
</code></pre>

<p>AND</p>

<pre><code>db.sideservices.find({"providers._id":ObjectId("5c65866488a1c53464e46dca")},{'providers.$':1})
</code></pre>

<p>But when using the same functions in nodejs, it returns the whole object instead document with the given id.</p>

<pre><code>this.db.collection('sideservices').find({'providers':{'$elemMatch':{'_id':ObjectId('5c65866488a1c53464e46dca')}}}).toArray((err,res) =&gt; {...})
</code></pre>

